import express from "express";
import { connectDB } from "./src/database/index"; // Importar la funci√≥n de conexi√≥n
import 'dotenv/config'

const app = express();
const port = process.env.PORT || 3000;

// Funci√≥n para iniciar la aplicaci√≥n
const startApp = async () => {
    try {
        await connectDB(); // Esperar a que se complete la conexi√≥n a la base de datos

        app.listen(port, () => {
            console.log(`Server is running on port ${port}`);
        });
    } catch (error) {
        console.error("Error connecting to the database:", error);
    }
};

// Llamar a la funci√≥n para iniciar la aplicaci√≥n
startApp();

